INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3263850315398', 'Échalote', 'Petits pois extra-fins surgelés Ingrédients 100% pois extra-fins. Conseils de préparation A la casserole : verser dans une casserole d\'eau bouillante salée les petits pois surgelés. Porter de nouveau à ébullition puis laisser cuire 6 minutes. Egoutter et assaisonner selon votre goût A l\'autocuiseur : verser l\'équivalent d\'un à deux verres d\'eau dans l\'autocuiseur. Mettre les petits pois encore surgelés et fermer. Laisser cuire 2 minutes à partir de la rotation de la soupape. Conditions de conservation A replacer au froid après l\'achat dans un délai d\'une heure au maximum ou dans ies deux heures si vous disposez d\'un conteneur isotherme pour le transport. * 24 h dans le réfrigérateur. 3 jours dans le compartiment à glace du réfrigérateur. Plusieurs mois dans le congélateur à -180C jusqu\'à la date indiquée sur 3\' emballage. NE JAMAIS RECONGELER UN PRODUIT DÉCONGELÉ A consommer de préférence avant fin : voir ci-contre. Valeurs énergétique et nutritionnelles moyennes', '', '1', '1', '16.5', '7.7', '12', '10.4', '0.83', '0.326771653543307', '', '1');

