VALUES ('3263850763519', 'Barre céréales, chocolat noir', 'Céréales 40% [riz soufflé: (farine de riz, farine de blé, sucre, extrait de malt de blé, émulsifiant : lécithine de tournesol), flocons d\'avoines 13%, pétales de maïs (maïs, sel,extrait de malt d\'orge, émulsifiant : lécithine de tournesol)], sirop de glucose, chocolat 20% [chocolat noir 11% (pâte de cacao, sucre, cacao maigre en poudre, émulsifiant : lécithine de soja, arôme), chocolat 9% (sucre, pâte de cacao, lactose, lait entier en poudre, lait écrémé en poudre, cacao maigre en poudre, lactosérum en poudre, matière grasse laitière, émulsifiant : lécithine de soja, arôme)], humectants : sorbitol, glycérol (soja), pâte au noisettes (sucre, matière grasse végétale, noisette, lait écrémé en poudre, cacao maigre en poudre, émulsifiant : lécithine de soja, arôme), huile de tournesol, sucre, arôme, émulsifiant : lécithine de soja.', 'https://static.openfoodfacts.org/images/products/326/385/076/3519/front.6.400.jpg', '11.1', '5.3', '69', '18', '4.3', '5.3', '0.254', '0.1', '', '1');

