VALUES ('3263850763618', 'Barres cereales - chocolat au lait - noix de coco', 'Céréales 37,5% (flocons d\'_avoine_ 16%, farine de _blé_ 9%, pétales de _blé_ complet, (_blé_ complet, sel, extrait de malt d\'_orge_), farine de riz), sirop de glucose, chocolat au _lait_ 15% (sucre, beurre de cacao, _lait_ entier en poudre, pâte de cacao, émulsifiant (lecithine de tournesol et de _soja_, arôme), fruits 8,4% (noix de coco 6%, _noisette_), huile de tournesol, stabilisant (sorbitol), dextrose, sucre, caramel aromatique (sucre, eau, correcteur d\'acidité (hydroxyde de sodium), sel, arôme, émulsifiant (lecithine de _soja_), antioxydant (tocophérol)', 'https://static.openfoodfacts.org/images/products/326/385/076/3618/front.4.400.jpg', '16.1', '8.6', '65.4', '28.9', '', '6.3', '0.3', '0.118110236220472', '', '0');

